import React from "react";
import { NavLink } from "react-router-dom";

import "../style/header.css";

const Header = ({ isHome }) => {
  return (
    <header>
      <NavLink to='/'>
        <h3>React Router DOM v5</h3>
      </NavLink>
      {isHome && (
        <ul>
          <li>
            <NavLink to='/login'>Login</NavLink>
          </li>
          <li>
            <NavLink to='/register'>Sign Up</NavLink>
          </li>
        </ul>
      )}
    </header>
  )
}


export default Header
